// src/helpers/remove-comments.ts
function removeComments(code) {
  const codeWithoutSingleLineComments = code.replace(/\/\/.*?\n/g, "");
  const codeWithoutComments = codeWithoutSingleLineComments.replace(
    /\/\*[\s\S]*?\*\//g,
    ""
  );
  return codeWithoutComments;
}

// src/helpers/get-userId-questionsId-status.ts
async function getUserId_QuestionId_CurrentQuestionStatus({
  email,
  quesNumber,
  prisma: prisma2
}) {
  try {
    const user = await prisma2.user.findUnique({ where: { email } });
    const question = await prisma2.question.findUnique({
      where: {
        quesNumber
      }
    });
    if (!user || !question) {
      return {
        dbFetchError: true,
        userId: "",
        questionId: "",
        currentQuestionStatus: "ToDo"
      };
    }
    const userQuestionRealtion = await prisma2.userQuestionStatus.findUnique({
      where: {
        userId_questionId: { userId: user.id, questionId: question.id }
      }
    });
    const currentQuestionStatus = userQuestionRealtion?.status || "ToDo";
    return {
      dbFetchError: false,
      userId: user.id,
      questionId: question.id,
      currentQuestionStatus
    };
  } catch (error) {
    return {
      dbFetchError: true,
      userId: "",
      questionId: "",
      currentQuestionStatus: "ToDo"
    };
  }
}

// src/helpers/update-db-on-code-submit.ts
async function updateDbOnCodeSubmit({
  userId,
  questionId,
  status,
  prisma: prisma2
}) {
  try {
    const newUserQuestionStatus = await prisma2.userQuestionStatus.upsert({
      where: {
        userId_questionId: {
          userId,
          questionId
        }
      },
      update: {
        status
      },
      create: {
        userId,
        questionId,
        status
      }
    });
    await prisma2.user.update({
      where: {
        id: userId
      },
      data: {
        questions: {
          connect: {
            userId_questionId: {
              userId,
              questionId
            }
          }
        }
      }
    });
    await prisma2.question.update({
      where: {
        id: questionId
      },
      data: {
        users: {
          connect: {
            userId_questionId: {
              userId,
              questionId
            }
          }
        }
      }
    });
    return true;
  } catch (error) {
    return false;
  }
}

