// src/helpers/get-user-profile-data.ts
async function getUserProfileData({
  email,
  prisma: prisma2
}) {
  try {
    const userData = await prisma2.user.findUnique({
      where: { email },
      include: {
        questions: {
          include: { question: true }
        }
      }
    });
    if (!userData) {
      throw new Error("no user found");
    }
    const userSolvedQuestions = {
      easy: userData.questions.filter(
        (ques) => ques.status === "Solved" && ques.question.difficulty === "Easy"
      ).length || 0,
      medium: userData.questions.filter(
        (ques) => ques.status === "Solved" && ques.question.difficulty === "Medium"
      ).length || 0,
      hard: userData.questions.filter(
        (ques) => ques.status === "Solved" && ques.question.difficulty === "Hard"
      ).length || 0
    };
    const questionsData = await prisma2.question.findMany();
    const totalQuestions = {
      easy: questionsData.filter((ques) => ques.difficulty === "Easy").length || 0,
      medium: questionsData.filter((ques) => ques.difficulty === "Medium").length || 0,
      hard: questionsData.filter((ques) => ques.difficulty === "Hard").length || 0
    };
    return {
      dbFetchError: false,
      name: userData.name,
      email: userData.email,
      image: userData.image,
      totalQuestions,
      userSolvedQuestions
    };
  } catch (error) {
    return {
      dbFetchError: true,
      name: "",
      email: "",
      image: null,
      totalQuestions: { easy: 0, medium: 0, hard: 0 },
      userSolvedQuestions: { easy: 0, medium: 0, hard: 0 }
    };
  }
}

